const canvas = document.getElementById("canvas1");
const ctx = canvas.getContext("2d");
canvas.width = 1280;
canvas.height = 1280;

ctx.fillStyle = "black";
ctx.fillRect(0, 0, canvas.width, canvas.height);

const img = new Image();
img.src = "data:image/jpeg;base64,";
img.width = 1280;
img.height = 853;
img.addEventListener("load", function(){
    ctx.drawImage(img, 0, 0);
    const scannedData = ctx.getImageData(0, 0, img.width, img.height);
    ctx.fillStyle = "black";
    ctx.fillRect(0, 0, canvas.width, canvas.height);
    
    for(var i = 0; i < scannedData.data.length/6; i++){
        const randomX = Math.floor(Math.random() * img.width);
        const randomY = Math.floor(Math.random() * img.height);
        const color = "rgb(" + scannedData.data[(randomX + randomY * img.width) * 4] + ", " + scannedData.data[(randomX + randomY * img.width) * 4 + 1] + ", " + scannedData.data[(randomX + randomY * img.width) * 4 + 2] + ")";
        new Particle(randomX, randomY, color);
    }
});

class Particle{
    constructor(x, y, color){
        this._x = x;
        this._y = y;
        this._color = color
        this._size = Math.random() * 3.5 + 1;
        this._angle = Math.random() * Math.PI * 2;
        this._distance = Math.floor(Math.random() * 2) + 1;
        this.draw();
    }
    draw(){
        while(this._distance > 0){
            ctx.fillStyle = this._color;
            ctx.beginPath();
            ctx.arc(this._x, this._y, this._size, 0, Math.PI * 2);
            ctx.fill();
            this._x -= Math.cos(this._angle) * 5;
            this._y -= Math.sin(this._angle) * 5;
            this._distance--;
        }
    }
}